 типа при монтаже электрических сетей и линий телекоммуникаций. Труба ПНД двустенная также может применяться для обустройства дренажных и ливневых систем.Преимущества гофрированной двустенной трубы:гибкость и пластичность;гибкость ипластичность;малый вес;устойчивость к деформациям;срок службы до 50 лет;устойчивость к окислению, коррозии;способность выдерживать длительные статические нагрузки. \r\nНаша организация занимается свыше 10 лет производством полиэтиленовых труб высокого качества. \r\nМы будем рады Вас видеть у нас на вебресурсе', 'Приветствую Вас товарищи! \r\nhttp://oderalon.net/home/viewtopic.php?f=43&t=412556\r\nhttp://arabfm.net/vb/showthread.php?p=4186512#post4186512\r\nhttp://www.jeepin.com/forum/member.php?u=97009\r\nhttp://arabfm.net/vb/showthread.php?p=4188895#post4188895\r\nhttps://www.heroscapers.com/community/member.php?u=491801\r\n \r\nТруба двустенная гофрированная широко используется для подземной прокладки инженерных коммуникаций при строительстве жилых и производственных объектов. Гофрированные трубы надежно защищают кабельные линии, водопроводные и канализационные сети от проникновения влаги и механических повреждений. Также они применяются в ливневых системах частных домов, для защиты систем теплоснабжения. Такие трубы используют не только для закладки в грунт, но и при заливке в бетонные стены и полы. Применяют их и для наружной прокладки электрических и оптоволоконных линий, в помещениях с повышенной влажностью, на чердаках и в подвалах.Двустенные трубы могут быть изготовлены из:поливинилхлорида (ПВХ);полипропилена (ПП);полиэтилена высокого или низкого давления (ПВД или ПНД труба).По своей структуре гофрированная двустенная труба состоит из гладкого и пластичного внутреннего слоя и верхнего, более жесткого слоя гофры. Такое строение позволяет повсеместно использовать трубы этого типа при монтаже электрических сетей и линий телекоммуникаций. Труба ПНД двустенная также может применяться для обустройства дренажных и ливневых систем.Преимущ